import  React from "react";
import {Button, Col, Form, FormGroup, Input, Label} from "reactstrap";
import axios from "axios";

class CustomerCheckOutForm extends React.Component {

    state = {
        name: '',
        email: '',
        phoneno: '',
        checkouttime: ''
    };

    handleFormSubmit = (event) => {
        event.preventDefault();

        const {name, email, phoneno, checkouttime} = this.state;

        const details = {
            name,
            email,
            phoneno,
            checkouttime
        };

        axios
            .post('/customer/checkoutform', details)
            .then((res) => console.log(res))
            .catch(err => {
                console.error(err);
            });
    };

    changeName = (event) => {
        this.setState({name: event.target.value},() => {console.log(this.state.name)});
    };

    changeEmail = (event) => {
        this.setState({email: event.target.value}, () => {console.log(this.state.email)});
    };

    changePhoneNo = (event) => {
        this.setState({phoneno: event.target.value}, () => {console.log(this.state.phoneno)});
    };

    changeCheckOutTime = (event) => {
        this.setState({checkouttime: event.target.value}, () => {console.log(this.state.checkouttime)});
    };

    componentDidMount() {
        const getdetails = () => {
            try {
                return axios.get('/customer/checkoutform')
            } catch (e) {
                throw e;
            }
        };

        const checkoutdetails = async () => {
            const details = await getdetails();

            if(details.data) {
                console.log(details.data);
            }
        };

        checkoutdetails();
    }

    render() {
        return (
            <div className="customerOptions">
                <Form onSubmit={this.handleFormSubmit}>
                    <FormGroup row>
                        <Col sm={3}>
                            <Label for="phonenumber" sm={2}>Phone Number</Label>
                        </Col>
                        <Col sm={8}>
                            <Input type="tel" name="phonenumber" id="phonenumber" value={this.state.phoneno} onChange={this.changePhoneNo} />
                        </Col>
                        <Col></Col>
                    </FormGroup>
                    <FormGroup check row>
                        <Col sm={{ size: 10, offset: 2 }}>
                            {/*just flip from true to  false*/}
                            <Button disabled={false}>Submit</Button>
                        </Col>
                    </FormGroup>
                    <FormGroup row>
                        <Col sm={3}>
                            <Label for="name" sm={2}>Name</Label>
                        </Col>
                        <Col sm={8}>
                            <Input type="text" ref="name" name="name" id="name" value={this.state.name} onChange={this.changeName} />
                        </Col>
                        <Col></Col>
                    </FormGroup>
                    <FormGroup row>
                        <Col sm={3}>
                            <Label for="email" sm={2}>Email</Label>
                        </Col>
                        <Col sm={8}>
                            <Input type="email" ref="email" name="email" id="exampleEmail" value={this.state.email} onChange={this.changeEmail} />
                        </Col>
                        <Col></Col>
                    </FormGroup>
                    <FormGroup row className="checkoutTime">
                        <Col sm={3}>
                            <Label for="checkouttime" sm={2}>CheckOut Time</Label>
                        </Col>
                        <Col sm={8}>
                            <Input type="datetime-local" ref="checkouttime" name="checkouttime" id="checkouttime" value={this.state.checkouttime} onChange={this.changeCheckOutTime} />
                        </Col>
                        <Col></Col>
                    </FormGroup>
                    <FormGroup check row>
                        <Col sm={{ size: 10, offset: 2 }}>
                            {/*just flip from true to  false*/}
                            <Button disabled={false}>Submit</Button>
                        </Col>
                    </FormGroup>
                </Form>
            </div>
        )
    }
}

export default CustomerCheckOutForm;
